import React, {Component} from "react";
import {Breadcrumb, BreadcrumbItem} from "reactstrap";
import CustomTabs from "../../components/tabs/customTabs";
import {connect} from "react-redux";

class LocalizeTab extends Component{
    constructor(props) {
        super(props)
    }
    render() {
        console.log(this.props.languages)
        return (
            <CustomTabs>
                {this.props.languages.map(function (lang) {
                    return <Breadcrumb>
                        <BreadcrumbItem active>{lang.name}</BreadcrumbItem>
                    </Breadcrumb>
                })}
                <div>
                    <Breadcrumb>
                        <BreadcrumbItem active>Home</BreadcrumbItem>
                    </Breadcrumb>
                    <Breadcrumb>
                        <BreadcrumbItem>
                            <Link to="/components/bootstrap/breadcrumbs">
                                Home
                            </Link>
                        </BreadcrumbItem>
                        <BreadcrumbItem active>Library</BreadcrumbItem>
                    </Breadcrumb>
                    <Breadcrumb>
                        <BreadcrumbItem>
                            <Link to="/components/bootstrap/breadcrumbs">
                                Home
                            </Link>
                        </BreadcrumbItem>
                        <BreadcrumbItem>
                            <Link to="/components/bootstrap/breadcrumbs">
                                Library
                            </Link>
                        </BreadcrumbItem>
                        <BreadcrumbItem active>Data</BreadcrumbItem>
                    </Breadcrumb>
                </div>
            </CustomTabs>


        );
    }
}
const mapStateToProps = state => {
    return {
        languages: state.languages.languages,

    }
};

export default connect(mapStateToProps)(LocalizeTab);
